    COALESCE( t1."Leaf_3", t1."Leaf_8", t1."Leaf_10", t1."Leaf_11", t1."Leaf_12", t1."Leaf_14", t1."Leaf_15", t1."Leaf_16", t1."Leaf_21", t1."Leaf_22", t1."Leaf_28", t1."Leaf_30", t1."Leaf_32", t1."Leaf_33", t1."Leaf_34", t1."Leaf_37", t1."Leaf_38", t1."Leaf_40", t1."Leaf_43", t1."Leaf_45", t1."Leaf_46", t1."Leaf_52", t1."Leaf_53", t1."Leaf_54", t1."Leaf_55", t1."Leaf_56", t1."Leaf_57", t1."Leaf_58", t1."Leaf_59", t1."Leaf_60", t1."Leaf_66", t1."Leaf_67", t1."Leaf_68", t1."Leaf_74", t1."Leaf_75", t1."Leaf_76", t1."Leaf_78", t1."Leaf_79", t1."Leaf_80", t1."Leaf_83", t1."Leaf_84", t1."Leaf_87", t1."Leaf_89", t1."Leaf_90", t1."Leaf_91", t1."Leaf_93", t1."Leaf_95", t1."Leaf_96", t1."Leaf_97", t1."Leaf_99", t1."Leaf_100" ) AS node_id
