    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_36" <= 4.500000) AND (t."X_27" <= 7.500000)) THEN 3 ELSE NULL END AS "Leaf_3",
